import {React, StrictMode} from "react"
import createRoot from 'react-dom/client'

import App from "./App"

let rootElement = document.querySelector('#root')
let root = createRoot(rootElement)

root.render(
    <StrictMode>
        <App />
    </StrictMode>
)
